def idk(img_1,img_2):#first is colored, second is grayscale(strict rule)

    image = cv2.GaussianBlur(img_1, (9, 9), 0)
    hsv = cv2.cvtColor(image, cv2.COLOR_BGR2HSV)
    mask = cv2.inRange(hsv, (60, 75, 75), (76, 220,220))
    imask = mask>0
    green = np.zeros_like(image, np.uint8)
    green[imask] = image[imask]
    image=green
    gray = cv2.cvtColor(image, cv2.COLOR_BGR2GRAY)
    blurred = cv2.GaussianBlur(gray, (9, 9), 0)
    edged = cv2.Canny(blurred, 50, 200, 255)
    img_1=edged
    ret, thresh = cv2.threshold(img_1, 127, 255, 0)
    ret, thresh2 = cv2.threshold(img_2, 127, 255, 0)
    contours1, hierarchy = cv2.findContours(thresh, 2, 1)
    cnt1 = contours1[1]
    contours2, hierarchy = cv2.findContours(thresh2, 2, 1)
    cnt2 = contours2[1]
    ret = cv2.matchShapes(cnt1, cnt2, 1, 0.0)

    return(ret)

